import Card from "./components/card";
import { trekData } from "./trekInfo";

function App() {
  return (
    <div className="flex flex-row">
      <h2 className=" ml-10">Upcoming Treks</h2>
      {trekData.map((item) => <Card key={item.id} data={item} />)}
    </div>
  );
}

export default App;
